    <>
    
    <iframe src="http://lotrproject.com/map/#zoom=3&lat=-1344&lon=1500&layers=BTTTTT" width="60%" height="400px" allowfullscreen="" loading="lazy" referrerpolicy="no-referrer-when-downgrade"></iframe>
    </>
  )
}

export default GTComp01;
